mscVncsVpMaxVoiceBitRate = MibTableColumn((1, 3, 6, 1, 4, 1, 562, 36, 2, 1, 44, 3, 3, 1, 1), Integer32().subtype(subtypeSpec=ConstraintsUnion(SingleValueConstraint(0, 1, 2, 3))).clone(namedValues=NamedValues(("n64", 0), ("n32", 1), ("n24", 2), ("n16", 3))).clone('n64')).setMaxAccess("readwrite")
if mibBuilder.loadTexts: mscVncsVpMaxVoiceBitRate.setStatus('obsolete')
if mibBuilder.loadTexts: mscVncsVpMaxVoiceBitRate.setDescription('This attribute specifies the maximum encoding bit rate (minimum compression rate) that will be used for voice data. This attribute was migrated to the max element of the g711G726 row of the voiceRates attribute.')
mscVncsVpMinVoiceBitRate = MibTableColumn((1, 3, 6, 1, 4, 1, 562, 36, 2, 1, 44, 3, 3, 1, 2), Integer32().subtype(subtypeSpec=ConstraintsUnion(SingleValueConstraint(0, 1, 2, 3))).clone(namedValues=NamedValues(("n64", 0), ("n32", 1), ("n24", 2), ("n16", 3))).clone('n16')).setMaxAccess("readwrite")
if mibBuilder.loadTexts: mscVncsVpMinVoiceBitRate.setStatus('obsolete')
if mibBuilder.loadTexts: mscVncsVpMinVoiceBitRate.setDescription('This attribute specifies the minimum encoding bit rate (maximum compression rate) that will be used for voice data. Migration information: If minVoiceBitRate is 64 kbit/s, it means that the user did not accept any compression. To get the same effect with the current provisioning, we set Vncs/m Vp/n voiceEncodingChoice first = g711Only, second = none and third = none. If minVoiceBitRate is 16, 24 or 32 kbit/s, it means that the user did accept compression. To get the same effect with the current provisioning, we set the minimum g711G726 rate in Vncs/m VoiceProfile/n voiceRates to minVoiceBitRate and leave voiceEncodingChoice with its default values.')
mscVncsVpMaxModemBitRate = MibTableColumn((1, 3, 6, 1, 4, 1, 562, 36, 2, 1, 44, 3, 3, 1, 3), Integer32().subtype(subtypeSpec=ConstraintsUnion(SingleValueConstraint(0, 1, 2, 3))).clone(namedValues=NamedValues(("n64", 0), ("n32", 1), ("n24", 2), ("n16", 3))).clone('n64')).setMaxAccess("readwrite")
if mibBuilder.loadTexts: mscVncsVpMaxModemBitRate.setStatus('obsolete')
if mibBuilder.loadTexts: mscVncsVpMaxModemBitRate.setDescription('This attribute was migrated to the max element of the g711G726 row of the modemFaxRates attribute. DESCRIPTION')
mscVncsVpMinModemBitRate = MibTableColumn((1, 3, 6, 1, 4, 1, 562, 36, 2, 1, 44, 3, 3, 1, 4), Integer32().subtype(subtypeSpec=ConstraintsUnion(SingleValueConstraint(0, 1, 2, 3))).clone(namedValues=NamedValues(("n64", 0), ("n32", 1), ("n24", 2), ("n16", 3))).clone('n32')).setMaxAccess("readwrite")
if mibBuilder.loadTexts: mscVncsVpMinModemBitRate.setStatus('obsolete')
if mibBuilder.loadTexts: mscVncsVpMinModemBitRate.setDescription('This attribute has been obsoleted. Migration information is as follows: If minModemBitRate is 64 kbit/s, it means that the user did not accept any compression. To get the same effect with the current provisioning, we set Vncs/m Vp/n modemFaxEncodingChoice first = g711Only, second = none and third = none. If minModemBitRate is 16, 24 or 32 kbit/s, it means that the user did accept compression. To get the same effect with the current provisioning, we set the minimum g711G726 rate in Vncs/m VoiceProfile/n modemFaxRates to minModemBitRate and leave modemFaxEncodingChoice with its default values. DESCRIPTION')
mscVncsVpAudioGain = MibTableColumn((1, 3, 6, 1, 4, 1, 562, 36, 2, 1, 44, 3, 3, 1, 5), Integer32().subtype(subtypeSpec=ConstraintsUnion(SingleValueConstraint(0, 1, 2, 3, 4, 5, 6))).clone(namedValues=NamedValues(("minus6", 0), ("minus4", 1), ("minus2", 2), ("n0", 3), ("n2", 4), ("n4", 5), ("n6", 6))).clone('n0')).setMaxAccess("readwrite")
if mibBuilder.loadTexts: mscVncsVpAudioGain.setStatus('obsolete')
if mibBuilder.loadTexts: mscVncsVpAudioGain.setDescription('This attribute has been migrated to VRoute Interface egressAudioGain.')
mscVncsVpSilenceSuppression = MibTableColumn((1, 3, 6, 1, 4, 1, 562, 36, 2, 1, 44, 3, 3, 1, 6), Integer32().subtype(subtypeSpec=ConstraintsUnion(SingleValueConstraint(0, 1, 2, 3, 4))).clone(namedValues=NamedValues(("off", 0), ("on", 1), ("congested", 2), ("slow", 3), ("slowAndCongested", 4))).clone('on')).setMaxAccess("readwrite")
if mibBuilder.loadTexts: mscVncsVpSilenceSuppression.setStatus('mandatory')
if mibBuilder.loadTexts: mscVncsVpSilenceSuppression.setDescription('This attribute specifies when silence suppression is desired during voice traffic on an audio call. If silenceSuppression is off, silence suppression is never desired. If silenceSuppression is on, silence suppression is always desired. If silenceSuppression is congested, silence suppression is desired only when the network is congested. If silenceSuppression is slow, silence suppression is desired only after 20 seconds without audio. If silenceSuppression is slowAndCongested, both the slow and congested options are desired. The negotiated silence suppression is available in Vsr Svs Framer negotiatedSilenceSuppression.')
mscVncsVpEchoCancellation = MibTableColumn((1, 3, 6, 1, 4, 1, 562, 36, 2, 1, 44, 3, 3, 1, 7), Integer32().subtype(subtypeSpec=ConstraintsUnion(SingleValueConstraint(0, 1))).clone(namedValues=NamedValues(("off", 0), ("on", 1))).clone('on')).setMaxAccess("readwrite")
if mibBuilder.loadTexts: mscVncsVpEchoCancellation.setStatus('obsolete')
if mibBuilder.loadTexts: mscVncsVpEchoCancellation.setDescription('This attribute has been migrated to VRoute Interface echoCancellation.')
mscVncsVpSilenceSuppressionFactor = MibTableColumn((1, 3, 6, 1, 4, 1, 562, 36, 2, 1, 44, 3, 3, 1, 8), Unsigned32().subtype(subtypeSpec=ValueRangeConstraint(0, 60)).clone(40)).setMaxAccess("readwrite")
if mibBuilder.loadTexts: mscVncsVpSilenceSuppressionFactor.setStatus('mandatory')
if mibBuilder.loadTexts: mscVncsVpSilenceSuppressionFactor.setDescription('This attribute specifies the expected savings (percent reduction) in required bandwidth if silence suppression is used. If silence suppression is used, the bandwidth required for the connection will be lower than if silence suppression is not used. However, the routing system will not be aware of the unused bandwidth unless that bandwidth is specified by this attribute. If the value specified for the expected savings is too low, then some bandwidth made available by the use of silence suppression will be wasted. If the value specified for the expected savings is too high, then some connections may fail to set up because the routing system will over-calculate the amount of bandwidth available. The effectiveness of silence suppression can be influenced by language related speech patterns.')
mscVncsVpDataCallsAccepted = MibTableColumn((1, 3, 6, 1, 4, 1, 562, 36, 2, 1, 44, 3, 3, 1, 9), Integer32().subtype(subtypeSpec=ConstraintsUnion(SingleValueConstraint(0, 1))).clone(namedValues=NamedValues(("no", 0), ("yes", 1))).clone('yes')).setMaxAccess("readwrite")
if mibBuilder.loadTexts: mscVncsVpDataCallsAccepted.setStatus('mandatory')
if mibBuilder.loadTexts: mscVncsVpDataCallsAccepted.setDescription('This attribute specifies whether data calls are allowed if this profile is used.')
mscVncsVpFaxIdleSuppressionG711G726 = MibTableColumn((1, 3, 6, 1, 4, 1, 562, 36, 2, 1, 44, 3, 3, 1, 15), Integer32().subtype(subtypeSpec=ConstraintsUnion(SingleValueConstraint(0, 1))).clone(namedValues=NamedValues(("off", 0), ("on", 1))).clone('on')).setMaxAccess("readwrite")
if mibBuilder.loadTexts: mscVncsVpFaxIdleSuppressionG711G726.setStatus('mandatory')
if mibBuilder.loadTexts: mscVncsVpFaxIdleSuppressionG711G726.setDescription('This attribute specifies the fax idle suppression parameter used during negotiation with the remote end across the subnet. It applies only to fax traffic, not voice or modem traffic. The negotiated G.711/G.726 fax idle suppression is available in Vsr Svs Framer negotiatedFisG711G726.')
mscVncsVpInsertedOutputDelay = MibTableColumn((1, 3, 6, 1, 4, 1, 562, 36, 2, 1, 44, 3, 3, 1, 17), Integer32().subtype(subtypeSpec=ConstraintsUnion(SingleValueConstraint(5, 15, 22, 30, 35, 40, 45, 50, 75, 100, 125, 150))).clone(namedValues=NamedValues(("n5", 5), ("n15", 15), ("n22", 22), ("n30", 30), ("n35", 35), ("n40", 40), ("n45", 45), ("n50", 50), ("n75", 75), ("n100", 100), ("n125", 125), ("n150", 150))).clone('n22')).setMaxAccess("readwrite")
if mibBuilder.loadTexts: mscVncsVpInsertedOutputDelay.setStatus('mandatory')
if mibBuilder.loadTexts: mscVncsVpInsertedOutputDelay.setDescription('This attribute specifies the amount of added output delay used to compensate for cross network delay variations. It applies to voice, modem and fax traffic. It is required to add output delay so that the statistical variation in the transit time of cells crossing the network does not cause gaps in speech. Backbone networks where high priority traffic consumes a high percentage of trunk bandwidth will require a higher insertedOutputDelay to compensate for the greater cell delay variation (CDV). This attribute is ignored if this call runs on a 1pDS1V or 1pE1V card.')
mscVncsVpVoiceTrafficOptimization = MibTableColumn((1, 3, 6, 1, 4, 1, 562, 36, 2, 1, 44, 3, 3, 1, 18), Integer32().subtype(subtypeSpec=ConstraintsUnion(SingleValueConstraint(0, 1))).clone(namedValues=NamedValues(("bandwidth", 0), ("delay", 1))).clone('bandwidth')).setMaxAccess("readwrite")
if mibBuilder.loadTexts: mscVncsVpVoiceTrafficOptimization.setStatus('obsolete')
if mibBuilder.loadTexts: mscVncsVpVoiceTrafficOptimization.setDescription('This attribute is not supported now. This attribute specifies how to optimize voice traffic. Setting voiceTrafficOptimization to bandwidth specifies that voice traffic should be optimized to preserve bandwidth. Setting voiceTrafficOptimization to delay specifies that voice traffic should be optimized to minimize delay.')
mscVncsVpDtmfRegeneration = MibTableColumn((1, 3, 6, 1, 4, 1, 562, 36, 2, 1, 44, 3, 3, 1, 19), Integer32().subtype(subtypeSpec=ConstraintsUnion(SingleValueConstraint(0, 1))).clone(namedValues=NamedValues(("off", 0), ("on", 1))).clone('off')).setMaxAccess("readwrite")
if mibBuilder.loadTexts: mscVncsVpDtmfRegeneration.setStatus('mandatory')
if mibBuilder.loadTexts: mscVncsVpDtmfRegeneration.setDescription('This attribute specifies the DTMF regeneration parameter used during negotiation with the remote end across the subnet. If dtmfRegeneration is on, it is desired that DTMF tones received from the link are first converted to digits before being sent to the subnet. When a digit is received from the subnet, its respective DTMF tone is desired to be generated before being sent to the link. If dtmfRegeneration is off, it is desired that DTMF tones are transported transparently as audio. DTMF regeneration is not supported on 1pDS1V, 1pE1V, and J2MV cards. On these cards, the value of dtmfRegeneration is ignored. The negotiated DTMF regeneration is available in Vsr Svs Framer negotiatedDtmfRegeneration.')
mscVncsVpV17EncodedAsG711G726 = MibTableColumn((1, 3, 6, 1, 4, 1, 562, 36, 2, 1, 44, 3, 3, 1, 20), Integer32().subtype(subtypeSpec=ConstraintsUnion(SingleValueConstraint(0, 1))).clone(namedValues=NamedValues(("no", 0), ("yes", 1))).clone('no')).setMaxAccess("readwrite")
if mibBuilder.loadTexts: mscVncsVpV17EncodedAsG711G726.setStatus('mandatory')
if mibBuilder.loadTexts: mscVncsVpV17EncodedAsG711G726.setDescription('This attribute specifies how services using this VoiceProfile negotiate with V.17 fax machines. This attribute is not used unless the negotiated fax encoding, available in Vsr Svs Framer negotiatedEncoding, is v29V27Relay and the negotiated modemFax encoding, available in Vsr Svs Framer negotiatedEncoding, is g711, g726 or g711G726. If v17EncodedAsG711G726 is no, it is desired that V.17 fax machines be instructed to use V.29 so that V.29 fax traffic sent by fax machines can be demodulated and encoded using fax relay. If v17EncodedAsG711G726 is yes, it is desired that V.17 fax machines be permitted to use V.17 so that V.17 fax traffic sent by fax machines can be encoded using G.711 or G.726. The actual encoding performed depends on the negotiated minimum and maximum modemFax rates, available in Vsr Svs Framer negotiatedRates. The actual negotiation between services using this VoiceProfile and V.17 fax machines is available in Vsr Svs Framer negotiatedV17AsG711G726.')
