if mibBuilder.loadTexts: mscVncsVpNewModemFaxRatesTable.setStatus('mandatory')
if mibBuilder.loadTexts: mscVncsVpNewModemFaxRatesTable.setDescription('This attribute specifies the minimum and maximum modemFax and fax rate parameters used during negotiation with the remote end across the subnet. For g711Only encoding, all modem/fax traffic is carried uncompressed at 64 kbit/s, so this row of modemFaxRates cannot be changed. For g711G726 encoding, rates can change during modemFax and fax traffic due to congestion in the network. The minimum and maximum rates that can occur during the modemFax traffic are specified by the g711G726 row of modemFaxRates. The relay row of modemFaxRates specifies the minimum and maximum rates of sending fax machines that are allowed for fax relay. relay does not apply to modem calls. The negotiated minimum and maximum modemFax and fax rates are available in Vsr Svs Framer negotiatedRates.')
